import React from 'react'
import { moves } from './data'
import PokeMoveCard from './PokeMoveCard'

const PokeMoves = () => {
  return (
    <div>
        <h1>PokeMoves</h1>

            {moves.map(item => (
                <PokeMoveCard key={item.id} {...item}/>
            ))}

    </div>
  )
}

export default PokeMoves
